import { createChatBotMessage } from 'react-chatbot-kit';

const config = {
  botName: "BookBot",
  initialMessages: [
    createChatBotMessage("Hi! I can help you with the Book Catalog. Ask me how to add, update, or delete books.")
  ],
};

export default config;
